43X)"]},{"cell_type":"markdown","id":"f447bbc4","metadata":{"papermill":{"duration":0.009762,"end_time":"2024-03-14T07:02:15.259175","exception":false,"start_time":"2024-03-14T07:02:15.249413","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"7a654aec","metadata":{"papermill":{"duration":0.009833,"end_time":"2024-03-14T07:02:15.280486","exception":false,"start_time":"2024-03-14T07:02:15.270653","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"8936016c","metadata":{"execution":{"iopub.execute_input":"2024-03-14T07:02:15.305251Z","iopub.status.busy":"2024-03-14T07:02:15.302832Z","iopub.status.idle":"2024-03-14T07:02:15.391596Z","shell.execute_reply":"2024-03-14T07:02:15.389355Z"},"papermill":{"duration":0.104001,"end_time":"2024-03-14T07:02:15.394397","exception":false,"start_time":"2024-03-14T07:02:15.290396","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>